Description:
  Profil Perusahaan  COMPANY PROFILE.Ratu Tlatah Agung adalah perusahaan yang memproduksi berbagai macam bakery yang dioles dengan cream khusus kemudian dikeringkan, biasa dikenal dengan nama Bagelen. Perusahaan   didirikan di Kota Kediri pada tanggal 16 Februari 1999, menempati area tanah seluas kurang lebih 2000 meter persegi terletak di Jalan Kantil, Kelurahan Ngampel, Kecamatan Mojoroto, Kota Kediri. 
Perusahaan didirikan dengan legalitas sebagai berikut: 
1.	Tanda Daftar Industri (TDI);
2.	Surat Ijin Usaha Perdagangan (SIUP);
3.	Tanda Daftar Perusahaan (TDP);
4.	Ijin Mendirikan Bangunan (IMB);
5.	Ijin Undang-Undang Gangguan (HO);
6.	Sertifikat Penyuluhan Keamanan Pangan;
7.	Sertifikat Produksi Pangan Industri Rumah Tangga;
8.	Sertifikat Merek PADUKA yang dikeluarkan oleh Departemen Hukum Dan HAM;
9.	Sertifikat Halal dari LPPOM  MUI (masih dalam proses).  JENIS PRODUKSI
1.	BAGELEN PADUKA VANILA;
2.	BAGELEN PADUKA CLASSIC;
3.	BAGELEN PADUKA PRO ROOMBUTTER;
4.	BAGELEN PADUKA LEMON.
Selain melayani penjualan retail dan grossir kami juga melayani penjualan secara los atau curah untuk dikemas ulang oleh perusahaan pengemas ulang.KUALITAS
Management sangat serius menjaga kualitas semua jenis bagelen yang diproduksi. Oleh karena itu semua bahan, baik bahan baku utama, bahan tambahan pangan maupun bahan penolong yang digunakan harus memenuhi syarat MD yang dikeluarkan oleh Balai POM dan syarat Halal yang dikeluarkan oleh LPPM  MUI. 
Selain itu syarat higiene dalam alur proses produksi juga sangat kami utamakan, yang meliputi  alat-alat produksi, alat-alat bantu yang digunakan karyawan, tempat penyimpanan bahan baku, tempat penyimpanan produk jadi, lingkungan kerja serta sumber daya manusianya.SUMBER DAYA MANUSIA
Managemen telah membuat dan menentukan job description bagi masing-masing bagian. Semuanya guna menunjang terbentuknya organisasi yang baik agar dapat dihasilkan out put produksi yang baik pula. Peranan quality control (QC) juga diterapkan agar produk yang dilepas ke pasaran benar-benar memenuhi syarat.
Secara periodik semua karyawan mendapatkan pembinaan terutama mengenai sanitasi, sedangkan pembinaan yang berkaitan dengan ketrampilan dilakukan setiap saat. PEMASARAN.
