  Profil Perusahaan  PT Valsindo Mitra Teknik adalah perusahaan perdagangan umum yang beroperasi secara professional dengan prinsip saling menguntungkan sehingga memberi manfaat sebesar – besarnya baik bagi perusahaan maupun customer kami.
Dalam rangka memenuhi kepuasan customer , kami berkomitmen untuk memberikan support yang terbaik untuk customer dengan memberikan pelayan secara cepat , tepat dan tentunya berkualitas.
Sudah menjadi komitmen kami untuk melayani customer tidak hanya menjalin hubungan bisnis saja akan tetapi kami bertekad untuk memberikan solusi yang cerdas dalam setiap kendala yang dihadapi customer kami.Produk Utama PT Valsindo Mitra Tekni :
1 . Safety Equipment { Hand Protection , Body Protection , Eye Protection , Head and Face Protection , High Protection , Protective Clothing , Respiratori Protection , Hearing Protection , Foot Protection }
2 . Lubricant And Chemical Maintenance { Mobil Oil,Taiho Kohzai }
3 . Abrasive And Tolls { K55 , I-Prix , Taiyo , Tekiro , M10 }

  Profil Perusahaan  Didirikan pada tahun 2015, Raihan Trans Logistik memulai usahanya dengan kuat di dalam Industri Cargo, Awal tahun 2015 RT Logistics memperluas usahanya dengan pengiriman yang lebih besar seperti kendaraan.
• Cargo Darat;
• Cargo Udara;
• Cargo Laut.
Raihan Trans Logistic mengalami perkembangan dengan pesat dan telah menciptakan hubungan kepercarayaan yang cukup baik, seiring berjalannya waktu RT Logistic telah tumbuh dan mempunyai kekuatan yang signifikan di dalam industri transportasi dengan koneksi yang kuat.
